import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';
import './App.css';
import Join from './component/Join/Join';
import Chat from "./component/Chat/Chat"

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" Component={Join} />
        <Route path="/chat" Component={Chat}/>
      </Router>
    </div>
  );
}

export default App;
